import styled from "@emotion/styled";

export const Li = styled.li`
    display: flex;
    margin: 20px 0;
    border: 1px solid white;
    border-radius: 10px;
    padding: 10px;
    max-height: 30px;
    justify-content: space-between;
`
export const List = styled.div`
    width: auto;
    height: auto;
    background-color: transparent;
    border: none;
    color: black;
    font-size: 20px;
    margin-right: 15px;
`

export const Icons = styled.div`
    display: none;
`
